class PriorityQueue {
  constructor() {
    this.heap = [];
  }
  
  push(item) {
    this.heap.push(item);
    this.heap.sort((a, b) => a[0] - b[0]);
  }
  
  pop() {
    return this.heap.shift();
  }
  
  isEmpty() {
    return this.heap.length === 0;
  }
}

